import React from 'react';
import logo from ".././Image/logo1.png";

const Header = () => {
  return (
    <>
      <nav className='navbar'>

      <div className="logo">
        <img src={logo} alt="dev logo" />
      </div>

      </nav>
    </>
  )
}

export default Header
